import React from "react"
import { Box, Typography } from "@mui/material"

import { PillProps } from "./types"

const Pill = ({ label }: PillProps) => (
  <Box>
    <Typography variant="body1">
      {label}
    </Typography>
  </Box>
);

export default Pill;
